import React from 'react';

const List = (props) => {
  return (
          <div className="tweet-list">
              {props.sort((a, b)=>b.date.localeCompare(a.date)).map((tweet) => ( 
                  <div key={tweet.id} className="tweet-item">
                    <div className="tweet-header">
                      <div className="post-date">{tweet.date}</div>
                      <div className="post-user">{tweet.user}</div>
                    </div>
                    <div>
                      <div className="tweet-context">{tweet.text}</div>
                    </div>                  
                  </div>
              ))}
          </div> 
  );
}

export default List;
